import React, { useEffect, useState } from "react";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";
import Dashboard from "./screens/Dashboard";
import Landing from "./screens/Landing";

const App = () => {
  const [user, setUser] = useState({});

  useEffect(() => {
    // Utilisateur fictif
    const fakeUser = {
      email: "fakeuser@example.com",
      name: "Fake User",
    };

    // Remplacer l'utilisateur importé par l'utilisateur fictif
    setUser(fakeUser);
  }, []);

  return (
    <BrowserRouter>
      <Routes>

        <Route
          path="*"
          element={
            user?.email ? <Dashboard user={user} /> : <Navigate to="/login" />
          }
        />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
